USE Unitrac



SELECT * FROM dbo.LENDER_PAYEE_CODE_FILE LPC
WHERE LPC.LENDER_ID = 2319


SELECT LPC.ID INTO #tmpNO FROM dbo.LENDER_PAYEE_CODE_FILE LPC
JOIN dbo.LENDER_PAYEE_CODE_MATCH LPM ON LPM.LENDER_PAYEE_CODE_FILE_ID = LPC.ID
WHERE LPC.LENDER_ID = 2319


SELECT * FROM dbo.LENDER_PAYEE_CODE_FILE LPC
LEFT JOIN dbo.LENDER_PAYEE_CODE_MATCH LPM ON LPM.LENDER_PAYEE_CODE_FILE_ID = LPC.ID
WHERE LPC.LENDER_ID = 2319 AND LPC.ID NOT IN (SELECT * FROM #tmpNO)

SELECT * FROM dbo.LENDER_PAYEE_CODE_FILE LPC
LEFT JOIN dbo.LENDER_PAYEE_CODE_MATCH LPM ON LPM.LENDER_PAYEE_CODE_FILE_ID = LPC.ID
WHERE LPC.LENDER_ID = 2319 AND LPC.ID  IN (SELECT * FROM #tmpNO)

UPDATE LPM
SET LPM.REMITTANCE_TYPE_CD = 'BIC'
FROM dbo.LENDER_PAYEE_CODE_MATCH LPM
WHERE id = 29673



DECLARE @Name NVARCHAR(255)

SELECT @Name = COMP_NAME_TX 
FROM dbo.LENDER_PAYEE_CODE_FILE LPC
LEFT JOIN dbo.LENDER_PAYEE_CODE_MATCH LPM ON LPM.LENDER_PAYEE_CODE_FILE_ID = LPC.ID
WHERE LPC.LENDER_ID = 2319 AND LPC.ID NOT IN (SELECT * FROM #tmpNO) AND LPC.ID NOT IN (79920)

